â €
Shish tawook is a famous middle eastern dish that you will find on the menu of each and every restaurant that serves mediterranean food.The chicken is diced then marinated in yogurt and spices  and you can bake or grill it! â €
This post is Part of #middleeasternfoodcollab by @juveriafoodsclubs 
INGREDIENTSâ €
For the Marination â €
1 cup yogurtâ €
4 tbsp cup olive oilâ €
1/3 cup tomato pasteâ €
1 tbsp garlic pasteâ €
1 tsp ginger powder â €
1 teaspoon salt (or to taste)â €
1/4 teaspoon black pepperâ €
1/2 teaspoon oreganoâ €
1/4 teaspoon cinnamonâ €
2 tbsp Mayonnaise â €
1/2 teaspoon Chicken powder â €
1 tbsp lemon juice â €
1/2 teaspoon paprika powder â €
1 tbsp soya sauce â €
1 kg boneless chicken breast cut into large chunksâ €
2 cups cubed vegetables (optional)â €
Skewers â €
INSTRUCTIONSâ €
â €
Add all marination ingredients to a medium bowl and whisk to combine. â €
Add the chicken and stir well. Cover and refrigerate for a few hours. â €
Put the veggies and chicken on the skewers. Grill or bake until chicken is golden and no longer pink, rotating half way through (about 15 minutes per side).â €
Sprinkle with parsley or cilantro. â €
Enjoy!â €
